import React from 'react';
import './Form.css';

const Form=()=>{
    return(
        <div className='addCategory'>
            <form>
            <h3>Add Category</h3>
            <div className='entries'>
            <label>Name:</label>
            <input name='name' type='text'/>
            </div>
            </form>
        </div>
    );
}

export default Form;
